import React, { Component } from 'react';
import styled from 'styled-components';
import { Repeat, Heart } from 'react-feather';

const Container = styled.div`
  svg {
    color: ${({ theme }) => theme.textSecondary};
  }
`;

const ExternalInteraction = () => {
  const { type, users } = this.props.externalInteraction;

  const generateDisplayText = () => {};
  const generateIcon = (type) => {
    switch (type) {
      case 'like':
        return <Heart />;
      case 'retweet':
        return <Repeat />;
      default:
        return null;
    }
  };

  return (
    <Container>
      {generateIcon(type)}
    </Container>
  );
};

export default ExternalInteraction;
